    {
      "lineNumber": 194752,
      "originalJapaneseLine": "「ランスJr.様をはじめとする、",
      "translatedEnglishLine": "\"Starting with Lord Rance Jr.,"
    },
    {
      "lineNumber": 194753,
      "originalJapaneseLine": "　『魔王の子』の命を狙っているという」",
      "translatedEnglishLine": "\"they say there are those aiming for the lives of the 'Children of the Demon King.'\""
    },
    {
      "lineNumber": 194754,
      "originalJapaneseLine": "「ああ、そういや、そんなのいたなぁ」",
      "translatedEnglishLine": "\"Ah, come to think of it, there was someone like that.\""
    },
    {
      "lineNumber": 194755,
      "originalJapaneseLine": "「あの部隊に動きがあったという噂は",
      "translatedEnglishLine": "\"Rumors of movements from that unit"
    },
    {
      "lineNumber": 194756,
      "originalJapaneseLine": "　この自由都市まで届いております。",
      "translatedEnglishLine": "have even reached this free city."
    },
    {
      "lineNumber": 194757,
      "originalJapaneseLine": "　もしかすると……」",
      "translatedEnglishLine": "Perhaps...\""
    },
    {
      "lineNumber": 194758,
      "originalJapaneseLine": "「ぐわはははははは！",
      "translatedEnglishLine": "\"Gwahahahahaha!"
    },
    {
      "lineNumber": 194759,
      "originalJapaneseLine": "　だったらなんだってんだ！",
      "translatedEnglishLine": "So what if that's the case!"
    },
    {
      "lineNumber": 194760,
      "originalJapaneseLine": "　相変わらず心配性な野郎だ！」",
      "translatedEnglishLine": "You're such a worrywart as always!\""
    },
    {
      "lineNumber": 194761,
      "originalJapaneseLine": "「この俺様は天下を総べる、",
      "translatedEnglishLine": "\"I, myself, am the son of the Demon King Rance, who rules the world!\""
    },
    {
      "lineNumber": 194762,
      "originalJapaneseLine": "　魔王ランスの息子だぞ！？",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 194763,
      "originalJapaneseLine": "「そんな連中、俺様が一ひねりよ！」",
      "translatedEnglishLine": "\"I can easily handle those kinds of people!\""
    },
    {
      "lineNumber": 194764,
      "originalJapaneseLine": "「……慢心は死を招くかと」",
      "translatedEnglishLine": "\"...Arrogance invites death, I think.\""
    },
    {
      "lineNumber": 194765,
      "originalJapaneseLine": "「出来れば避難の用意を――」",
      "translatedEnglishLine": "\"If possible, please prepare for evacuation—\""
    },
    {
      "lineNumber": 194766,
      "originalJapaneseLine": "「おい……」",
      "translatedEnglishLine": "\"Hey...\""
    },
    {
      "lineNumber": 194767,
      "originalJapaneseLine": "「うっ！」",
      "translatedEnglishLine": "\"Ugh!\""
    },
    {
      "lineNumber": 194768,
      "originalJapaneseLine": "「お前……」",
      "translatedEnglishLine": "\"You...\""
    },
    {
      "lineNumber": 194769,
      "originalJapaneseLine": "「俺様がそんな奴らに",
      "translatedEnglishLine": "\"Do you think I"
    },
    {
      "lineNumber": 194770,
      "originalJapaneseLine": "　負けると思ってやがるのかァ！？",
      "translatedEnglishLine": "would lose to those kinds of guys!?\""
    },
    {
      "lineNumber": 194771,
      "originalJapaneseLine": "ランスJr.が睨みを利かせ、",
      "translatedEnglishLine": "Rance Jr. gave a sharp glare,"
    },
    {
      "lineNumber": 194772,
      "originalJapaneseLine": "部隊隊長は息を呑む。",
      "translatedEnglishLine": "and the unit commander held his breath."
    },
    {
      "lineNumber": 194773,
      "originalJapaneseLine": "「し、しかし……」",
      "translatedEnglishLine": "\"B-But...\""
    },
    {
      "lineNumber": 194774,
      "originalJapaneseLine": "「だーっ！　うるせー野郎だ！」",
      "translatedEnglishLine": "\"Damn it! You're such a noisy guy!\""
    },
    {
      "lineNumber": 194775,
      "originalJapaneseLine": "「なら、まずはテメェが戦ってこい！」",
      "translatedEnglishLine": "\"Then you fight first!\""
    },
    {
      "lineNumber": 194776,
      "originalJapaneseLine": "「戦闘部隊隊長であるテメェがまず戦って、",
      "translatedEnglishLine": "\"You are the combat unit commander, so fight first,"
    },
    {
      "lineNumber": 194777,
      "originalJapaneseLine": "　本気で強きゃあ俺様がどうにかしてやる！",
      "translatedEnglishLine": "and if you're truly strong, I'll handle it somehow!"
    },
    {
      "lineNumber": 194778,
      "originalJapaneseLine": "　これでいいだろうが！」",
      "translatedEnglishLine": "Isn't that good enough!\""
    },
    {
      "lineNumber": 194779,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"............\""
    },
    {
      "lineNumber": 194780,
      "originalJapaneseLine": "男はランスJr.の楽天的な言葉に",
      "translatedEnglishLine": "The man was about to object to Rance Jr.'s optimistic words,"
    },
    {
      "lineNumber": 194781,
      "originalJapaneseLine": "反論しようかとしたが、",
      "translatedEnglishLine": "but"
    },
    {
      "lineNumber": 194782,
      "originalJapaneseLine": "しかし心配性が過ぎるのも事実と思い直し黙る。",
      "translatedEnglishLine": "he reconsidered and realized that worrying too much was also true, so he remained silent."
    },
    {
      "lineNumber": 194783,
      "originalJapaneseLine": "「了解いたしました」",
      "translatedEnglishLine": "\"Understood.\""
    },
    {
      "lineNumber": 194784,
      "originalJapaneseLine": "「けっ！　俺様はその間、女を抱いてるぞ！",
      "translatedEnglishLine": "\"Hmph! In the meantime, I'll be holding a woman!"
    },
    {
      "lineNumber": 194785,
      "originalJapaneseLine": "　テメェのせいで良い気分が台無しだ！」",
      "translatedEnglishLine": "Because of you, my good mood is ruined!\""
    },
    {
      "lineNumber": 194786,
      "originalJapaneseLine": "「ああ、そうだ。",
      "translatedEnglishLine": "\"Yeah, that's right."
    },
    {
      "lineNumber": 194787,
      "originalJapaneseLine": "　いつもみたいに情けはかけんじゃねぇぞ。",
      "translatedEnglishLine": "Don't go easy on them like you usually do."
    },
    {
      "lineNumber": 194788,
      "originalJapaneseLine": "　お前も普通に戦えば強いんだからな」",
      "translatedEnglishLine": "You are strong when you fight normally, you know.\""
    },
    {
      "lineNumber": 194789,
      "originalJapaneseLine": "「分かってんだろうな、ロッキー」",
      "translatedEnglishLine": "\"You understand that, don't you, Rocky?\""
    },
    {
      "lineNumber": 194790,
      "originalJapaneseLine": "名を呼ばれ、男が立ち上がる。",
      "translatedEnglishLine": "The man, called by name, stood up."
    },
    {
      "lineNumber": 194791,
      "originalJapaneseLine": "「……油断は致しません」",
      "translatedEnglishLine": "\"...I will not be careless.\""
    },
    {
      "lineNumber": 194792,
      "originalJapaneseLine": "「このロッキー・バンク。",
      "translatedEnglishLine": "\"I, Rocky Bank,"
    },
    {
      "lineNumber": 194793,
      "originalJapaneseLine": "　あのお方のご子息であられる貴方を、",
      "translatedEnglishLine": "swear to protect you, the esteemed son of that noble person,"
    },
    {
      "lineNumber": 194794,
      "originalJapaneseLine": "　必ずやお守りすると誓います」",
      "translatedEnglishLine": "without fail.\""
    },
    {
      "lineNumber": 194795,
      "originalJapaneseLine": "　",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 194796,
      "originalJapaneseLine": "　　＜ヌチュ、グチュリ……＞",
      "translatedEnglishLine": "＜Squish, squelch...＞"
    },
    {
      "lineNumber": 194797,
      "originalJapaneseLine": "靴に絡まりつくスライムを引き剥がすように",
      "translatedEnglishLine": "You peeled off the slime clinging to your shoes"
    },
    {
      "lineNumber": 194798,
      "originalJapaneseLine": "あなたは力を入れて歩みを進める。",
      "translatedEnglishLine": "and forced yourself to move forward."
    },
    {
      "lineNumber": 194799,
      "originalJapaneseLine": "真っ暗な筈の迷宮内は",
      "translatedEnglishLine": "The labyrinth, which should be pitch dark,"
    },
    {
      "lineNumber": 194800,
      "originalJapaneseLine": "スライムがほのかな光源となっているおかげで、",
      "translatedEnglishLine": "was faintly illuminated thanks to the slimes acting as light sources,"
    },
    {
      "lineNumber": 194801,
      "originalJapaneseLine": "あなた達にもなんとか進むことができた。",
      "translatedEnglishLine": "allowing you all to somehow proceed."
    },
    {
      "lineNumber": 194802,
      "originalJapaneseLine": "「なーんか気持ち悪い迷宮だねー」",
      "translatedEnglishLine": "\"This is kinda a creepy labyrinth, huh.\""
    },
    {
      "lineNumber": 194803,
      "originalJapaneseLine": "ランス団がアジトにしている",
      "translatedEnglishLine": "Cautiously, you advanced through the slime labyrinth"
    },
    {
      "lineNumber": 194804,
      "originalJapaneseLine": "メススライム迷宮の中を慎重に進む。",
      "translatedEnglishLine": "which the Rance group has made their hideout."
    },
    {
      "lineNumber": 194805,
      "originalJapaneseLine": "「きゃっ、またスライム踏んだ！",
      "translatedEnglishLine": "\"Eek, I stepped on a slime again!"
    },
    {
      "lineNumber": 194806,
      "originalJapaneseLine": "　うんしょ！」",
      "translatedEnglishLine": "Ugh!\""
    },
    {
      "lineNumber": 194807,
      "originalJapaneseLine": "あなたはアゴまで伝う汗をぬぐった。",
      "translatedEnglishLine": "You wiped the sweat running down to your chin."
    },
    {
      "lineNumber": 194808,
      "originalJapaneseLine": "スライムにとって居心地がいいのか、",
      "translatedEnglishLine": "Perhaps because it was comfortable for the slimes,"
    },
    {
      "lineNumber": 194809,
      "originalJapaneseLine": "迷宮内は湿度が高く、滲んだ汗で",
      "translatedEnglishLine": "the labyrinth was very humid, and your soaked sweat"
    },
    {
      "lineNumber": 194810,
      "originalJapaneseLine": "服がぺったり肌に貼り付いていた。",
      "translatedEnglishLine": "made your clothes stick tightly to your skin."
    },
    {
      "lineNumber": 194811,
      "originalJapaneseLine": "「ちょちょちょ！",
      "translatedEnglishLine": "\"W-W-Wait!\""
    }
  ]
}

